export default class LogicalGridConfig {

  constructor() {
    this.widget = null;
  }

  setWidget(widget) {
    this.widget = widget;
  }

  getGridColumnCount() {
    return this.widget.gridColumnCount;
  }

  getGridWidgets() {
    return this.widget.widgets;
  }
}
